import FeaturedProducts from "../../componemts/FeatureProducts/FeaturedProducts";
import Slider from "../../componemts/slider/Slider";

const Home = () => {
  return (
    <div>
      <Slider />
      <FeaturedProducts type="featured" />
      <FeaturedProducts type="trending" />
    </div>
  );
};

export default Home;
